INSERT INTO `lmp` VALUES ('WCF100717','Wehrli Universal 4in Inlet Dry Air Filter Use w/WCF Kits',' wcf100717* This is a universal item without fitment details. Please make sure this item is for your application. LMP does not guarantee fitment on universal items.Wehrli wcf100717 - Wehrli Universal 4in Inlet Dry Air Filter Use w/WCF Kits.Wehrli Universal 4in Inlet Dry Air Filter (Use w/WCF Kits)WCF100717WCF100717',84.50,'https://www.lmperformance.com/images/parts/5b9969cebc34b72043edd417e96e5d5a.jpg','/Images/lmp/WCF100717_lmp.jpg',0.0),('HS14LRF3SH','Invidia Lexus Rcf Q300h W/ Rolled Stainless Steel Tips Cat-Back Exhaust',' HS14LRF3SHInvidia HS14LRF3SH - Invidia Lexus Rcf Q300h W/ Rolled Stainless Steel Tips Cat-Back Exhaust; 2014-2019.The Invidia Q300 Exhaust features a flat bottom shaped muffler design results in improved high speed aerodynamic performance. The muffler inside contains continuous piping design and use of Advantex material that results in an excellent free-flow exhaust with optimized back pressure, giving greater horsepower, torque gains and a rich deep sporty sound.The use of SUS304 polished stainless steel piping, Mandrel bent to shape, state of the art CNC machine made flange, Robot TIG welding and double wall polished stainless steel or Titanium tips, provides the Invidia Q300 Exhaust with outstanding durability and appearance.Invidia Exhausts feature available Titanium Burnt Blue Exhaust Tips as well as full Stainless Steel Full exhaust systems. Full Titanium systems are also available which reduce weight and add performance.PIPE DIAMETER: 70mm',1362.90,'https://www.lmperformance.com/images/parts/hs14lrf3sh.jpg','/Images/lmp/HS14LRF3SH_lmp.jpg',0.0),('TR-2017L-D','aFe Takeda Stage-2 Pro Dry S Cold Air Intake System 15-17 Lexus RC F 5.0L V8',' TR-2017L-DaFe TR-2017L-D - aFe Takeda Stage-2 Pro Dry S Cold Air Intake System 15-17 Lexus RC F 5.0L V8; 2015-2017.Takeda intakes are constructed out of lightweight black wrinkle finish aluminum tubing or clear-coat anodized polished tubing for maximum air flow and a great style. This intake uses a large 360 degree high flow Pro DRY S air filter for maximum flow, filtration and convenience. The Pro DRY S air filter requires no oils and cleans with simple soap and water. Takeda intakes come complete with all tubing, filters, couplers and hardware for an easy installation.Takeda Stage-2 Cold Air Intake System w/ Pro DRY S Media Blue Lexus RC F 15-19 / GS F 16-19 V8-5.0LaFe Takeda Stage-2 Pro Dry S Cold Air Intake System 15-17 Lexus RC F 5.0L V8Takeda Stage-2 Cold Air Intake System w/ Pro DRY S Media BlueTakeda Stage-2 Cold Air Intake SystemLexus RC F 15-18 V8-5.0LTakeda Intake SystemAvailable to Order',453.10,'https://www.lmperformance.com/images/parts/668cf1a8c779f1bd3d80307e91af5caa.jpg','/Images/lmp/TR-2017L-D_lmp.jpg',0.0),('CF-100002','APR Performance Universal Hood Vents Carbon Fiber',' CF-100002* This is a universal item without fitment details. Please make sure this item is for your application. LMP does not guarantee fitment on universal items.APR Performance CF-100002 - APR Performance Universal Hood Vents Carbon Fiber.Excessive heat can cause major and expensive damage to critical components in a car. Engine bays, radiators, brakes, transmissions, and differentials all need good air flow to help transfer away unwanted heat. APR carbon fiber hood vents help channel out excessive heat that builds up in the engine bay. Built using pre-preg. Carbon fiber reinforced polymer (CFRP) composite materials for superior strength-to-weight ratio, these universal hood vents for sale by APR add both function and lightness where it counts.The Universal APR Cabon Fiber Hood Vents Feature:',413.82,'https://www.lmperformance.com/images/parts/cf-100002.jpg','/Images/lmp/CF-100002_lmp.jpg',0.0),('HD15LXRCF-OE','Seibon 15-17 Lexus RC F OEM Style Carbon Fiber Hood',' hd15lxrcf-oeSeibon hd15lxrcf-oe - Seibon 15-17 Lexus RC F OEM Style Carbon Fiber Hood; 2015-2017.Seibon packs all products carefully to prevent damage during shipping. However, damage may still occur occasionally. Buyer must inspect the packaging and the products carefully upon receiving them, then accept the shipment and notate any damages and irregularities, such as crushed, torn, punctured, or broken parts on both the packaging and the product, on the freight bill or receipt at the driver\'s presence. Buyer must retain all cartons, packing materials, and damaged products for the carrier\'s damage inspector to inspect. Do not refuse shipment or return it without approval, because the buyer\'s right to make a damage claim may be denied. A signed receipt without any notation indemnifies the carrier as well as Seibon from any further damage claims. Discovery of damages after a clear delivery becomes the responsibility of the customer. All damages must be notified to carrier and Seibon within 24 hours. In cases of damage with proper notation on receipt, the carrier will determine whether to pay for repair cost or replacement value of the damaged goods after damage inspection. Replacement value is the amount the buyer paid to the distributor and is not negotiable. All disputes about the settlement amount should be addressed with the carrier. Seibon, under no circumstances, shall be liable for the damaged product or for subsequent settlement of the claim with the carrier.Alll items are made to order and may require extra time to be manufactured.OEM-style carbon fiber hood for 2015-2017 Lexus RCFSeibon 15-17 Lexus RC F OEM Style Carbon Fiber Hood2015 - 2017 LEXUS RC-F OE HOODHood; BonnetHoodIMPORTANT DELIVERY INSTRUCTIONS: PLEASE INSPECT ALL TRUCK FREIGHT SHIPPED ITEMS OUT OF THE BOX BEFORE SIGNING FOR THE DELIVERY. If parts arrive damaged or missing, please do not SIGN for delivery and REFUSE the package. If the driver will not let you refuse it without signing for it then sign \"DAMAGED\" or \"PARTS MISSING\". If the parts are refused and not damaged or missing, the customer will be responsible for shipping. If the driver refuses to let you inspect the delivery please accept the package and sign \"DRIVER DID NOT LET ME INSPECT PARTS\".',1382.72,'https://www.lmperformance.com/images/parts/25b288dd729062056fdcfcc095a6025b.jpg','/Images/lmp/HD15LXRCF-OE_lmp.jpg',0.0),('RS15LXRCF','Seibon 15-17 Lexus RC F OEM Style Carbon Fiber Rear Spoiler',' rs15lxrcfSeibon rs15lxrcf - Seibon 15-17 Lexus RC F OEM Style Carbon Fiber Rear Spoiler; 2015-2017.Seibon packs all products carefully to prevent damage during shipping. However, damage may still occur occasionally. Buyer must inspect the packaging and the products carefully upon receiving them, then accept the shipment and notate any damages and irregularities, such as crushed, torn, punctured, or broken parts on both the packaging and the product, on the freight bill or receipt at the driver\'s presence. Buyer must retain all cartons, packing materials, and damaged products for the carrier\'s damage inspector to inspect. Do not refuse shipment or return it without approval, because the buyer\'s right to make a damage claim may be denied. A signed receipt without any notation indemnifies the carrier as well as Seibon from any further damage claims. Discovery of damages after a clear delivery becomes the responsibility of the customer. All damages must be notified to carrier and Seibon within 24 hours. In cases of damage with proper notation on receipt, the carrier will determine whether to pay for repair cost or replacement value of the damaged goods after damage inspection. Replacement value is the amount the buyer paid to the distributor and is not negotiable. All disputes about the settlement amount should be addressed with the carrier. Seibon, under no circumstances, shall be liable for the damaged product or for subsequent settlement of the claim with the carrier.Alll items are made to order and may require extra time to be manufactured.Seibon 15-17 Lexus RC F OEM Style Carbon Fiber Rear SpoilerOE-style carbon fiber rear spoiler for 2015-2017 Lexus RCF2015 - 2017 LEXUS RC-F OE REAR SPOILERWing; Rear Spoiler; Spoiler; Rear WingREAR SPOILERSpoilerIMPORTANT DELIVERY INSTRUCTIONS: PLEASE INSPECT ALL TRUCK FREIGHT SHIPPED ITEMS OUT OF THE BOX BEFORE SIGNING FOR THE DELIVERY. If parts arrive damaged or missing, please do not SIGN for delivery and REFUSE the package. If the driver will not let you refuse it without signing for it then sign \"DAMAGED\" or \"PARTS MISSING\". If the parts are refused and not damaged or missing, the customer will be responsible for shipping. If the driver refuses to let you inspect the delivery please accept the package and sign \"DRIVER DID NOT LET ME INSPECT PARTS\".',654.50,'https://www.lmperformance.com/images/parts/1d85de4e12ee855d7412d5e48c9668eb.jpg','/Images/lmp/RS15LXRCF_lmp.jpg',0.0),('PC55-BT','Pedal Commander Lexus / Scion / Toyota Throttle Controller',' PC55-BTPedal Commander PC55-BT - Pedal Commander Lexus / Scion / Toyota Throttle Controller.Fitments',299.99,'https://www.lmperformance.com/images/parts/da0f91ba794e40f354db864a465dbb4a.jpg','/Images/lmp/PC55-BT_lmp.jpg',0.0),('35257006','KW Suspension Coilover Variant 3 Inox Lexus RC-F',' 35257006KW 35257006 - KW Suspension KW Coilover Variant 3 Inox Lexus RC-F; 2015-2019.KW Coilover Variant 3 inoxKW Variant 3: Unlimited individuality for performance & comfort.Damping forces can be adjustment separately in rebound & compression.The patented KW-valve technology for separate adjustment of rebound and compression damping allows you to individually setup your suspension.The adjustable KW bottom valve adjusts the low-speed range of the compression level in twelve clicks.With the KW coilovers Variant 3 inox-line you will get much more than just a sporty lowering and excellent driving behaviour on all roads. It is based on our long experience as a suspension manufacturer and supplier for international motor sport, such as the touring car series ADAC GT Masters, FIA GT1, FIA GT3, International GT Open, WTC, VLN and the legendary ADAC Zurich 24h-race Nurburgring.By increasing the rebound force via the adjustment wheel body movements are reduced. You will have more stability during high speed cornering. If you change for example the wheel / tire combination (approved by the car manufacturer) to larger wheels, then with a KW coilover Variant 3 inox-line you will be able to adjust the car\'s handling perfectly.Print product descriptionThe KW coilover Variant 3 inox-line kit and every single damper are subject to extensive quality tests during production to meet the high standards of our KW quality management. This is the only way we can meet our expectations to give up to five years warranty on our KW coilover Variant 3 inox-line when installed at one of our KW specialist dealer. KW coilover struts made of stainless steel are 100% rust-free and an unlimited life time.Therefore the operation of the continuous lowering via the dirt-resistant KW trapezoid thread and the KW composite collar is also not affected after years. By the individual lowering with its continuous adjustment range, you can emphasize the sportiness of your vehicle visually. A feature that is very popular in the performance-oriented tuning scene.KW Variant 3 Coilover System features:AttributesThe KW coilover kit Variant 3 inox-line is the perfect accessory for performance-oriented drivers and tuning enthusiasts who put a great demand on their suspension. The separately rebound and compression damping adjustable dampers with their well-thought-through click adjustment allow a perfect setup. So it is easy to influence the steering behaviour, directional stability, tire grip and handling characteristics when driving on the limit.Important Part Information: Fitment Details: RC-FCutting-edge motorsports technology for more performance on the road. With independently adjustable compression and rebound damping the Variant 3 damper setup can be tuned to your own driving preferences or vehicle modifications such as weight, tire characteristics or additional chassis bracing. True performance optimization is only possible with this unique, patented system. For example, the compression damping force can be increased to optimize grip from the tires, or improve cornering behavior and reduce squat without influencing the rebound damping characteristics that are optimally tuned to the spring rate.The KW Variant 3 inox-line coilover kit is the ideal tool for performance-oriented drivers and experienced tuning enthusiasts who place a strong emphasis on the overall performance of their suspension. The Variant 3 features patented TVR-A and TVC-A technology that provides separately adjustable rebound and compression damping. The extensive adjustment range of the independently configurable rebound and compression make it easy to directly influence the steering behavior, directional stability, grip and handling characteristics for confident and repeatable results at the limit of driving dynamics.The two-stage, patented TVR-A (Twin Valve Rebound - Adjustable) technology enables a small volume of oil to flow through an adjustable, conically shaped, low-speed bypass during low damper speeds, while in the case of higher damper speeds, the main rebound stage valve opens allowing a larger volumn of oil to flow. This provides a big improvement in terms of ride comfort without influencing the safety-relevant high-speed range. There are 16 precise clicks available for individual settings, so you can choose between more comfort or more body control.With 12 precise clicks, the KW Variant 3 coilovers utilize TVC-A (Twin Valve Compression - Adjustable) technology and can increase or decrease the flow of valve to achieve either more or less low speed compression damping. During sudden high speed impulses the spring loaded needle valve and the spring loaded main valve open to their maximum valve cross section, acting as a digressive blow-off characteristic to avoid transmitting undesired forces through the suspension into the chassis. This provides a better platform for the vehicle body and at the same time offers more comfort than with conventional valve technology during high wheel acceleration. The dampers come preset to our baseline shock settings right out of the box providing an optimal starting place for your car while providing a wide adjustment window for true performance optimization.With KW Variant 3 coilovers you can achieve maximum lowering within an approved lowering range that ensures a proper functioning suspension with adequate travel after your car is lowered. Even after years of use you can easily adjust the ride height thanks to the dirt resistant trapezoid thread and composite adjustment collar.As with all KW coilovers our engineers develop vehicle specific damper and spring specifications which undergo comprehensive testing on the Nurburgring Nordschleife and in our KW 7-post Driving Dynamic Test Center. With a KW Variant 3 coilover kit the driving experience is more dynamic and direct. You are not buying a mass produced, generic coilover kit, a KW coilover has been developed specifically for your particular vehicle. As a manufacturer, KW uses only its own resources, high quality components and the damper technology that has all developed in-house. With the KW Variant 3 inox-line coilovers, rolling motion of the body will be reduced during compression giving you the benefit of more direct handling and confidence while driving.For over 20 years, KW automotive has been the market leader and driving innovation as a manufacturer of individual suspension solutions for the road and in all types of motorsports. No matter where in the world, gearheads, automobile manufacturers and reputable tuners rely on our KW coilovers Made in Germany. Every KW coilover kit undergoes extensive stress testing before production and is developed and manufactured exclusively in our company headquarters in Fichtenberg, a small in town in Germany, to meet the high standards of our KW quality management. For us as a German manufacturer, it goes without saying that our KW coilover kits will exceed the original equipment manufacturer quality, and offer useful and innovative solutions. With an application list comprising more than 4, 600 options KW guarantees an outstanding selection backed by our Limited Lifetime Warranty.',3601.95,'https://www.lmperformance.com/images/parts/ffca3a22cbd9237fcc103032129e4b4c.jpg','/Images/lmp/35257006_lmp.jpg',0.0),('DM21R','Exedy Universal Hyper Multi Disc Assembly A/B/C Rigid Disc Fits TYR300',' dm21r* This is a universal item without fitment details. Please make sure this item is for your application. LMP does not guarantee fitment on universal items.Exedy dm21r - Exedy Universal Hyper Multi Disc Assembly A/B/C Rigid Disc Fits TYR300.EXEDY Replacement Parts are the essence of the commitment to quality that comes with every EXEDY product. As friction products, there will always be parts that wear. However, the quality that goes into every part we make ensures that they can be rebuilt and used over and over even with constant abuse. EXEDY offers a full range of replacement parts for all Stage 1, Stage 2 and Hyper Series clutches. This includes; friction discs, pressure plates, clutch covers, flywheels, intermediate plates and much more. Essentially, every component of every kit should be available if you need to replace it.EXEDY Replacement Parts are the essence of the commitment to quality that comes with every EXEDY product. As friction products, there will always be parts that wear. However, the quality that goes into every part we make ensures that they can be rebuilt aExedy Universal Hyper Multi Disc Assembly (A/B/C) Rigid Disc Fits TYR300Hyper Multi Disc Assembly (A/B/C); Rigid Disc; Fits TYR300Hyper Multi Disc Assembly (A/B/C); Rigid DiscHyper Multi Disc Assembly (A/B/C)Clutch Friction DiscReplacement PartsRebuild Parts',360.14,'https://www.lmperformance.com/images/parts/b1449eecebdac0605f566308cef0f661.jpg','/Images/lmp/DM21R_lmp.jpg',0.0),('30-10238','aFe MagnumFLOW OEM Replacement Air Filter PRO 5R 2015 BMW M3/M4 F80/F82 3.0L S55 tt Qty. 2',' 30-10238aFe 30-10238 - aFe MagnumFLOW OEM Replacement Air Filter PRO 5R 2015 BMW M3/M4 F80/F82 3.0L S55 tt Qty. 2; 2015-2015.Constructed with 100-percent polyurethane on top and bottom, this high flow, oiled OE replacement performance filter will outflow stock paper filter for improved horsepower and torque. Five layers of progressively finer mesh cotton gauze media provide maximum airflow for best performance results. Washable and reusable for multiple cleaning cycles, the tall open evenly spaced pleats provide excellent dust holding capacity for longer service cycle between cleanings. Integrated urethane bump seal insures tight, no leak seal over the life of the filter.Magnum FLOW OE Replacement Air Filter w/ Pro 5R Media BMW M2 Competition (F87) 2019 / M3 (F80) 15-18 / M4 (F82/83)15-18 L6-3.0L (tt) S55 / M6 (F12/13/06) 12-18 V8-4.4L (tt) S63aFe MagnumFLOW OEM Replacement Air Filter PRO 5R 2015 BMW M3/M4 (F80/F82) 3.0L S55 (tt) Qty. 2BMW M3 (F80)/M4 (F82/83) L6-3.0L (tt) S55/M6 (F12/13/06) 12-18 V8-4.4L (tt) S63Magnum FLOW OE Replacement Air Filter w/ Pro 5R MediaMagnum FLOW OE Replacement Air FilterAvailable to OrderMagnum FLOW Filter',224.70,'https://www.lmperformance.com/images/parts/e2d72aa0c72ceaed77bc4820f6bd4e5c.jpg','/Images/lmp/30-10238_lmp.jpg',0.0),('51-76305-CF','aFe POWER Momentum GT Pro Dry S Intake System 15-17 BMW M3/M4 S55 tt',' 51-76305-CFaFe 51-76305-CF - aFe POWER Momentum GT Pro Dry S Intake System 15-17 BMW M3/M4 S55 tt; 2015-2017.Unique Computer Design Carbon Fiber Housings: The simple yet elegant design of the one-piece sealed housings makes installation a snap and features our (Patent Pending) filter-to-housing interface. The housing is made out of lightweight high gloss, clear-coated twill weave carbon fiber. Dyno-Tuned Carbon Fiber Intake Tubes: Lightweight, high gloss, clear-coated twill weave carbon fiber tubes to achieve maximum power gains while maintaining a perfect fit. Large 3-Layer Oil-Free Performance Air Filter: This Momentum intake system was designed around the largest filter possible to allow maximum performance and filtration. This cone inverted top filter has a large 3-1/2 round flange and is 6-1/2 tall Pro DRY S filter media. The Pro DRY S performance air filter features 3-layers of progressively finer mesh synthetic oil-free media and is constructed with 100% polyurethane frame for long life and multiple cleaning cycles. Black Series Momentum Air Intake System: Also included in the kit is a Black Series serialized plate to assure the authenticity of the intake. Premium Hardware: Premium stainless steel clamps and a reinforced silicone coupler are used for strength and durability while also providing the most secure installation available. Momentum intakes are designed with fewer parts for a quick and simple installation. Note: This intake system is not CARB exempt at this time and is not legal for sale in California or use on vehicles registered with the California Department of Motor Vehicles.Black Series Carbon Fiber Cold Air Intake System w/ Pro DRY S Media BMW M3/M4 (F80/82/83) 15-19 L6-3.0L (tt) S55aFe POWER Momentum GT Pro Dry S Intake System 15-17 BMW M3/M4 S55 (tt)Black Series Carbon Fiber Cold Air Intake System w/ Pro DRY S MediaBMW M3/M4 (F80/82/83) 15-18 L6-3.0L (tt) S55Black Series Carbon Fiber Intake SystemMomentum Intake KitAvailable to Order',1615.78,'https://www.lmperformance.com/images/parts/7174d54794ee3fb98577c59038f7d93f.jpg','/Images/lmp/51-76305-CF_lmp.jpg',0.0),('HD14BMWF80-OE','Seibon Carbon Fiber Oe Style Hood Bmw F80',' HD14BMWF80-OESeibon HD14BMWF80-OE - Seibon Carbon Fiber Oe Style Hood Bmw F80; 2014-2016. Seibon BMW F80 Carbon Fiber OE Style HOOD  Seibon Carbon components are carefully hand-crafted using only the finest materials for your Vehicle. Every component is constructed 