 quality, sound, performance gains and enhanced fuel economy â€” all with an easy bolt-on installation. All BORLA street products carry an unsurpassed written million-mile warranty. Gains are usually 7-10% increase in HP.',1674.99,'https://www.lmperformance.com/images/parts/b140045.jpg','/Images/lmp/140045_lmp.jpg',0.0),('MMRAD-350Z-07','Mishimoto 07-09 Nissan 350Z Manual Aluminum Radiator',' mmrad-350z-07Mishimoto mmrad-350z-07 - Mishimoto 07-09 Nissan 350Z Manual Aluminum Radiator; 2007-2009.Your stock or modified 350Z demands a cooling system that can properly maintain optimal coolant temperatures. An inefficient cooling system can result in overheating, increased engine wear, and potential engine failure. Upgrade your factory plastic radiator with the Mishimoto Nissan 350Z Performance Aluminum Radiator. Our performance radiator features all-aluminum construction and precision robotic TIG-welding for consistency and durability. This radiator features a thick, 2-row brazed aluminum core capable of reducing coolant temperatures significantly. This radiator includes a Mishimoto 1.3 Bar High Pressure Radiator Cap, which effectively raises the boiling point of your coolant to create a safer and more efficient system. The Mishimoto 350Z Performance Aluminum Radiator features a magnetic oil drain plug with dowty seal and robust threads for durable repeated installation and superior protection against leaks. The sturdy aluminum end tanks feature a subtle brushed finish that complements any engine bay perfectly! As with all our products, this radiator includes the Mishimoto Lifetime Warranty, ensuring superior product quality and craftsmanship.Your stock or modified 350Z demands a cooling system that can properly maintain optimal coolant temperatures. An inefficient cooling system can result in overheating, increased engine wear, and potential engine failure. Upgrade your factory plastic radiator with the Mishimoto Nissan 350Z Performance Aluminum Radiator. Our performance radiator features all-aluminum construction and precision robotic TIG-welding for consistency and durability. This radiator features a thick, 2-row brazed aluminum core capable of reducing coolant temperatures significantly. This radiator includes a Mishimoto 1.3 Bar High Pressure Radiator Cap, which effectively raises the boiling point of your coolant to create a safer and more efficient system. The Mishimoto 350Z Performance Aluminum Radiator features a magnetic oil drain plug with dowty seal and robust threads for durable repeated installation and superior protection against leaks. The sturdy aluminum end tanks feature a subtle brushed finish that complements any engine bay perfectly! As with all our products, this radiator includes the Mishimoto Lifetime Warranty, ensuring superior product quality and craftsmanship.Mishimoto Nissan 350Z Performance Aluminum Radiator MMRAD-350Z-07Mishimoto 07-09 Nissan 350Z Manual Aluminum RadiatorNissan 350Z Performance Aluminum Radiator2007-2009 Nissan 350Z 3.5 Liter FS6R31AMishimoto MMRAD-350Z-07Aluminum RadiatorsRadiator',338.95,'https://www.lmperformance.com/images/parts/a5b8cf8799ce347b802fd44c558b05ee.jpg','/Images/lmp/MMRAD-350Z-07_lmp.jpg',0.0),('50474-6','H&R 15-18 BMW M3 Sedan F80 Sport Spring Incl. Adaptive M Susp./Competition Package',' 50474-6H&R 50474-6 - H&R 15-18 BMW M3 Sedan F80 Sport Spring Incl. Adaptive M Susp./Competition Package; 2015-2018.Sport Spring kits are H&R\'s number one selling product. Enhance the look of your vehicle with a reduced fender well gap. H&R\'sport Springs lower the vehicle\'s center of gravity and reduce body roll for better handling. The progressive spring rate design provides superb ride quality and comfort. A lower wind resistance signature will make the vehicle more streamlined and improve gas mileage. If you are only looking to improve one part of your vehicle\'s suspension, you cannot go wrong with installing Sport Springs. Fun to drive, H&R\'sport Springs are the number one upgrade for your vehicle.H&R 15-18 BMW M3 Sedan F80 Sport Spring (Incl. Adaptive M Susp./Competition Package)H&R Springs Sport Spring KitCoil Spring Lowering KitSport Spring KitSport SpringBMW',309.47,'https://www.lmperformance.com/images/parts/bf68b24fd67f0908a4bffcbe41e1db12.jpg','/Images/lmp/50474-6_lmp.jpg',0.0),('KLC140-255','Whiteline Universal Swaybar Link Kit-Heavy Duty Adjustable 10mm Ball/Ball Style',' klc140-255* This is a universal item without fitment details. Please make sure this item is for your application. LMP does not guarantee fitment on universal items.Whiteline klc140-255 - Whiteline Universal Swaybar Link Kit-Heavy Duty Adjustable 10mm Ball/Ball Style.Not many enthusiasts are aware that OE and more importantly aftermarket sway bar effectiveness can be hindered by worn or inadequate mounts, drop links and lateral stoppers. Whiteline adjustable sway bar links are engineered to be up to the task with top spec, light weight componentry combined with a window of adjustability, eliminating sway bar preload on installation but most importantly ensuring the maximum output of the sway bar for improved grip and better handling.Whiteline Universal Swaybar Link Kit-Heavy Duty Adjustable 10mm Ball/Ball StyleSuspension Stabilizer Bar Link KitSway bar - linkLink Kit',171.13,'https://www.lmperformance.com/images/parts/0f095467343ada197a801c79f1d437a8.jpg','/Images/lmp/KLC140-255_lmp.jpg',0.0),('SES1116ICPWB','Injen Intercooler Charge Pipes BMW M3 F80 3.0L L6 Twin turbo S55, Wrinkle Black',' SES1116ICPWBInjen SES1116ICPWB - Injen Intercooler Charge Pipes BMW M3 F80 3.0L L6 Twin turbo S55, Wrinkle Black; 2015-2016.Fitment Information: M3 (F80) 3.0L L6 Twin turbo S55 Intercooler charge pipes. Included two 1/8in Female NPT bungs for water/meth injection or datalog sensors. Mandrel bent Aluminum tubing with CNC machined turbo inlet flanges for O.E. fitment',619.95,'https://www.lmperformance.com/images/parts/4465d552159aa086b989e9107ae5158e.jpg','/Images/lmp/SES1116ICPWB_lmp.jpg',0.0),('PT0008B','Injen 01-06 BMW M3 3.2L / 15-18 BMW M3 3.0TT X-Pedal Pro Black Edition Throttle Controller',' pt0008bInjen pt0008b - Injen 01-06 BMW M3 3.2L / 15-18 BMW M3 3.0TT X-Pedal Pro Black Edition Throttle Controller; 2001-2006.The Injen Technology X-Pedal Pro Black Edition is the next step in customizable throttle response controllers. Quickly and easily tune out the delayed throttle response from the factory with Injen\'s X-Pedal Pro Black Edition for a completely new driving experience. You\'ll be amazed how different your vehicle feels after this quick and simple install!, , Modern vehicles are infamous for a sluggish and delayed throttle response feel directly from the factory. You\'ll recognize this built-in delay when trying to accelerate to pass another vehicle or merging into traffic. Injen Technology\'s X-Pedal Pro Black Edition allows you to adjust the pedal feel and ultimately the throttle response of your vehicle directly on the fly. , , The X-Pedal Pro Black Edition is a plug-in module that requires less than 5 minutes to install and delivers immediate, customized performance for your vehicle. Specifically, the X-Pedal Pro Black Edition controls the throttle signals going into your stock ECU (Engine Control Unit) so that your vehicle instantly responds faster and accelerates swifter... or slower and more economically ? depending on how you program the X-Pedal Pro Black Edition. The choice is yours.The Injen Technology X-Pedal Pro Black Edition is the next step in customizable throttle response controllers. Quickly and easily tune out the delayed throttle response from the factory with Injen?s X-Pedal Pro Black Edition for a completely new driving experience. You?ll be amazed how different your vehicle feels after this quick and simple install!Injen 01-06 BMW M3 3.2L / 15-18 BMW M3 3.0TT X-Pedal Pro Black Edition Throttle ControllerX-Pedal PRO Black Edition Throttle Controller, Part No. PT0008B, 1999-2020 BMW.X-Pedal PRO Black Edition Throttle ControllerInjen Throttle AssistThrottle Assist',229.95,'https://www.lmperformance.com/images/parts/tiny-jpg/7f7d8d059eeb720ed44f16ad307e323d.jpg','/Images/lmp/PT0008B_lmp.jpg',0.0),('S90-7-20-036','Eibach Pro-Spacer 20mm Spacer / Bolt Pattern 5x120 / Hub Center 72.5 for 12-17 BMW 650i F12/F13',' s90-7-20-036Eibach s90-7-20-036 - Eibach Pro-Spacer 20mm Spacer / Bolt Pattern 5x120 / Hub Center 72.5 for 12-17 BMW 650i F12/F13; 2012-2017.Eibach Pro-Spacer 20mm Spacer / Bolt Pattern 5x120 / Hub Center 72.5 for 12-17 BMW 650i (F12/F13)20mm Spacer / Bolt Pattern 5x120 / Hub Center 72.5PRO-SPACER Kit (20mm Pair)',166.60,'https://www.lmperformance.com/images/parts/f4ea4019ded7d09b265f087df31d1ec8.jpg','/Images/lmp/S90-7-20-036_lmp.jpg',0.0),('VH423704','Koyo 15-20 BMW M3/M4 F80/82/83 / 19-20 M2 Comp. F87 Alum. High-Perf. Front Mount Heat Exchanger',' vh423704Koyo vh423704 - Koyo 15-20 BMW M3/M4 F80/82/83 / 19-20 M2 Comp. F87 Alum. High-Perf. Front Mount Heat Exchanger; 2015-2020.Koyo 15-20 BMW (F8X) M3/M4/M2-Competition Aluminum High-Performance Front Mount Heat Exchanger',637.87,'https://www.lmperformance.com/images/parts/2dd1de923a5db7419f959b2ff1725108.jpg','/Images/lmp/VH423704_lmp.jpg',0.0),('AMS.38.14.0001-2','AMS Performance A90 2020 Toyota GR Supra Alpha 6 GTX3076 GEN II Turbo Kit 49 State Legal EPA Catted',' ams.38.14.0001-2AMS ams.38.14.0001-2 - AMS Performance A90 2020 Toyota GR Supra Alpha 6 GTX3076 GEN II Turbo Kit 49 State Legal EPA Catted; 2020-2022.AMS Performance A90 2020 Toyota GR Supra Alpha 6 GTX3076 GEN II Turbo Kit 49 State Legal EPA Catted',6207.95,'https://www.lmperformance.com/images/parts/cff622104813ff72fbb62b1935754ebf.jpg','/Images/lmp/AMS.38.14.0001-2_lmp.jpg',0.0),('HT-055016','Haltech Platinum PRO Direct Kit',' ht-055016Haltech ht-055016 - Haltech Platinum PRO Direct Kit.Haltech Nissan Z33 350Z (Excl HR Dual Throttle / M/T Only) Platinum PRO Direct Plug-In DBW Kit',1972.78,'https://www.lmperformance.com/images/parts/b761833fdaf8ca8eddde62880e93b6c0.jpg','/Images/lmp/HT-055016_lmp.jpg',0.0),('352208CG','KW Clubsport Kit 20+ Toyota GR Supra JTSC / 19+ BMW Z4 G29 2WD',' 352208cgKW 352208cg - KW Clubsport Kit 20+ Toyota GR Supra JTSC / 19+ BMW Z4 G29 2WD; 2020-2022.KW Clubsport Kit 20+ Toyota GR Supra (JTSC) / 19+ BMW Z4 (G29) 2WD',3702.54,'https://www.lmperformance.com/images/parts/736365454d181856e299d562397d83aa.jpg','/Images/lmp/352208CG_lmp.jpg',0.0),('28664-90','H&R 2019+ Toyota Supra A90 Sport Spring',' 28664-90H&R 28664-90 - H&R 2019+ Toyota Supra A90 Sport Spring; 2020-2022.H&R 2019+ Toyota Supra A90 Sport Spring',297.63,'https://www.lmperformance.com/images/parts/6d972c7ed8012f6af1e90dd69b0ea867.jpg','/Images/lmp/28664-90_lmp.jpg',0.0);
