INSERT INTO `vivid` VALUES ('WCF100717','WCFab 4 Inch Inlet Dry Air Filter For use with Kit s','Air Filter, Dry, 4 Inch Inlet, For use with WCFab Kits',65.96,'https://www.vividracing.com/wm.php/images/vr/2972/2021/WCF100717-HKWR.jpg','/Images/vivid/WCF100717_vivid.jpg',0.0),('HS14LRF3SH','Invidia Q300 Catback Exhaust Rolled Stainless Steel Tips Lexus RC-F 2015-2016','Invidia produces high performance parts for today\'s hottest tuner cars. Invidia knows that automotive enthusiasts are constantly looking for ways to extract more power from their engines and improve the driving experience. Using only the highest quality materials Invidia manufactures components that improve performance while remaining stylish. Invidia manufactures their exhaust systems specifically for each application to guarantee precise fitment and power gains. Invidia has applied their knowledge of automotive performance to a myriad of makes and models constantly refining and improving their product and design process. Invidia offers several exhaust system product lines to meet the expectations of nearly any automotive enthusiast.Invidia catback exhaust systems are designed specifically to improve performance, they achieve this by reducing bends in the exhaust system, using larger diameter piping. The reduced restriction also gives your vehicle a more aggressive tone for the sport enthusiast to enjoy. This improves throttle response, torque, horsepower and the overall driving experience. Catback exhausts are one of the most popular mods amongst casual and hardcore automotive enthusiasts alike. Their affordability, increase in performance, improved sound, and ease of installation make catback exhaust systems a perfect modification for nearly any vehicle. Invidia\'s Q300 exhaust systems feature a flat bottom muffler. The flat bottom shaped muffler design results in improved high speed aerodynamic performance. The muffler inside contains continuous piping design and use of Advantex material that results in an excellent free-flow exhaust with optimized back pressure, giving greater horsepower, torque gains and a rich deep sporty sound. The use of SUS304 polished stainless steel piping, Mandrel bent to shape, state of the art CNC machine made flange, Robot TIG welding and double wall polished stainless steel tips, provides outstanding durability and appearance.',1265.55,'https://www.vividracing.com/wm.php/images/HS14LRF3SH.jpg','/Images/vivid/HS14LRF3SH_vivid.jpg',0.0),('TR-2017L-D','TR-2017L-D Takeda Retain Stage-2 Pro DRY S Cold Air Intake System Lexus RC F/GS F 15-18 V8-5.0L','Large 3-Layer Performance Air Filter: This intake system utilizes an oil-free, large, 5\" tall conical 360 degree radial flow performance air filter with 3-Layer progressively finer porosity synthetic media for maximum convenience.Filter Flange Retention Design: The air filter uses a unique flange retention design that requires no hardware to mount the filter to the housing.High Quality ABS Plastic Housing w/ Carbon Fiber Look: aFe developed this high quality ABS plastic housing w/ carbon fiber look to snap into the factory airbox to provide a hassle-free installation utilizing factory mounting clips and locations.Mandrel-Bent Tubing: One-Piece 3-1/2\" Mandrel-Bent Electric Sparkle Blue Powder-Coated Intake Tube color matches the intake manifold and directs unrestricted airflow from the massive filter to the throttle body for more horsepower and torque. All clamps, silicone coupling, and hardware are included for hassle-free installation. This is a direct bolt-on kit that requires no cutting or drilling on OEM parts. Note: This intake system is not CARB exempt at this time and is not legal for sale in California or use on vehicles registered with the California Department of Motor Vehicles.',566.38,'https://www.vividracing.com/wm.php/images/AFE_TR-2017L-D.jpg','/Images/vivid/TR-2017L-D_vivid.jpg',0.0),('CF-100002','APR Performance Carbon Fiber Universal Long Hood Vents','Excessive heat can cause major and expensive damage to critical components in a car. Engine bays, radiators, brakes, transmissions, and differentials all need good air flow to help transfer away unwanted heat. APR Hood Vents help channel out excessive heat that builds up in the engine bay . Built using pre-preg. carbon fiber reinforced polymer (CFRP) composite materials for superior strength-to-weight ratio, APR Hood Vents add both function and \"lightness\" where it counts.',386.75,'https://www.vividracing.com/wm.php/images/CF-100002.jpg','/Images/vivid/CF-100002_vivid.jpg',0.0),('HD15LXRCF-OE','Seibon OEM Style Carbon Fiber Hood Lexus RC-F 15-19','Seibon Carbon components are carefully hand-crafted using only the finest materials. Our production team offers superior craftsmanship with over 15 years of experience working with carbon fiber.Every component is constructed with a consistent weave pattern. Our production processes allow exceptional carbon/resin ratio, creating high product stiffness that also leads to extra strength. For a stunning finish, our products are coated with a glossy clear coat that does not chip or flake. We meticulously inspect all of our components and stand firmly behind our products so that you can enjoy peace of mind with every genuine Seibon Carbon product.Creating performance-oriented products that help shed unnecessary weight without sacrificing style is our specialty. Race after race, Seibon products have proven to be as strong as the driver\'s ambition to win, thus making Seibon Carbon the preferred brand among professional drivers.',1122.00,'https://www.vividracing.com/wm.php/images/HD15LXRCF-OE.jpg','/Images/vivid/HD15LXRCF-OE_vivid.jpg',0.0),('RS15LXRCF','Seibon OEM Style Carbon Fiber Rear Spoiler Lexus RC-F 15-19','Seibon Carbon components are carefully hand-crafted using only the finest materials. Our production team offers superior craftsmanship with over 15 years of experience working with carbon fiber.Every component is constructed with a consistent weave pattern. Our production processes allow exceptional carbon/resin ratio, creating high product stiffness that also leads to extra strength. For a stunning finish, our products are coated with a glossy clear coat that does not chip or flake. We meticulously inspect all of our components and stand firmly behind our products so that you can enjoy peace of mind with every genuine Seibon Carbon product.Creating performance-oriented products that help shed unnecessary weight without sacrificing style is our specialty. Race after race, Seibon products have proven to be as strong as the driver\'s ambition to win, thus making Seibon Carbon the preferred brand among professional drivers.',654.50,'https://www.vividracing.com/wm.php/images/RS15LXRCF.jpg','/Images/vivid/RS15LXRCF_vivid.jpg',0.0),('PC55-BT','Pedal Commander Performance Throttle Controller 55 BT Toyota','Pedal Commander is a throttle response controller. It removes response delays on your electronic accelerator pedal. Effectively, it allows your engine to respond faster. As a result, your car can accelerate faster. You paid lots of money for your car, but when you press your gas pedal, you feel like you are pressing a sponge. Have you ever noticed that old cars were more responsive? We have a solution for you!!Pedal Commander BT has 4 different control modes: Eco,City, Sport, and Sport . Each control mode has 8 different sensitivity levels which you can choose. These 36 different parameters, in total, is what makes us different than others. Pedal Commander is programmable according to your desire within your car?s specifications. Now available with Bluetooth, you can download the Pedal Commander app from the Google Play Store or from the Apple Store. Our new Bluetooth system offers a more unique and user-friendly way to control your Pedal Commander unit. The Pedal Commander App allows for an end user to completely tuck away the PC system and control all of the functions directly from their phone, receive updates for new map and user programs instantly and gives you a wide range of options to adjust your Pedal Commander settings.Pedal Commander offers 4 program selections: ECO, CITY, SPORT  and SPORT+. Each mode has 9 different sensativity levels (upto 36 levels in total) and can be accessed by pressing the program button.',349.99,'https://www.vividracing.com/wm.php/images/sema/GHQP/PC55-BT_1.jpg','/Images/vivid/PC55-BT_vivid.jpg',0.0),('35257006','KW Coilover Kit V3 Lexus RC-F 2015+','The new Variant 3 is state-of-the-art technology for the skilled and experienced driver. The separate and independent compression and rebound Dampening options allow a truly individual driving set-up. These unique systems with the 3 individually adjustable components, allows for adjustment of the compression of the damper in the low-speed range, while the highspeed set-up, so decisive for driving comfort, has been preset by our engineers. ',3449.00,'https://www.vividracing.com/wm.php/images/202006/KW_352200DE.jpg','/Images/vivid/35257006_vivid.jpg',0.0),('DM21R','EXEDY Racing Clutch Hyper Multi Disc Assembly (A/B/C)','EXEDY Replacement Parts are the essence of the commitment to quality that comes with every EXEDY product. As friction products, there will always be parts that wear. However, the quality that goes into every part we make ensures that they can be rebuilt aHyper Multi Disc Assembly (A/B/C); Rigid Disc These products should work with your vehicle as they are universal for fitment.  We do recommend the customer researches and does due diligence regarding application.  This should help confirm that this will work for your vehicle.',346.89,'https://www.vividracing.com/wm.php/images/sema/CHFX/Replacement_Parts_Group.jpg','/Images/vivid/DM21R_vivid.jpg',0.0),('30-10238','aFe Power 30-10238 Magnum FLOW Pro 5R Air Filters BMW M3/M4 (F80/F82/F83) 15-20 L6-3.0L (tt) S55','Pro 5R Media: This filter features Pro 5R oiled 5-layer progressively finer mesh cotton gauze media for maximum performance. The progressive layering of media allows the filter to flow at high levels even when dirty. aFe performance air filters use a rounded, evenly spaced pleat design which produces more useable filter surface area for increased flow and greater dust holding capacity.Progressive Bump Seal: This pliable sealing surface conforms to even the most uneven filter housing. This design eliminates the use of gaskets or sealants. The soft urethane construction always goes back to its original form so you will never compress the bump seal. This makes for a perfect filter fit and sealing surface every time.Full Urethane Housing: aFe Power performance air filters are constructed using full 360 degree urethane frames. This construction allows for a proper OE style fit with excellent filter strength. aFe Power OE replacement performance filters have a limited life warranty.',280.88,'https://www.vividracing.com/wm.php/images/AFE_30-10238.jpg','/Images/vivid/30-10238_vivid.jpg',0.0),('51-76305-CF','aFe Power 51-76305-CF Black Series Momentum Carbon Fiber Pro DRY S Air Intake System BMW M3/M4 (F80/F82/F83) 15-19 L6-3.0L (tt) S55','Unique Computer Design Carbon Fiber Housings: The simple yet elegant design of the one-piece sealed housings makes installation a snap and features their filter-to-housing interface. The housing is made out of lightweight high gloss, clear-coated twill weave carbon fiber.Dyno-Tuned Carbon Fiber Intake Tubes: Lightweight, high gloss, clear-coated twill weave carbon fiber tubes to achieve maximum power gains while maintaining a perfect fit.Large 3-Layer \"Oil-Free\" Performance Air Filter: This Momentum intake system was designed around the largest filter possible to allow maximum performance and filtration. This cone inverted top filter has a large 3-1/2\" round flange and is 6-1/2\" tall Pro DRY S filter media. The Pro DRY S performance air filter features 3-layers of progressively finer mesh synthetic \"oil-free\" media and is constructed with 100% polyurethane frame for long life and multiple cleaning cycles.Black Series Momentum Air Intake System: Also included in the kit is a Black Series serialized plate to assure the authenticity of the intake.Premium Hardware: Premium stainless steel clamps and a reinforced silicone coupler are used for strength and durability while also providing the most secure installation available. Momentum intakes are designed with fewer parts for a quick and simple installation. Note: This intake system is not CARB exempt at this time and is not legal for sale in California or use on vehicles registered with the California Department of Motor Vehicles.',1937.25,'https://www.vividracing.com/wm.php/images/AFE_51-76305-CF.jpg','/Images/vivid/51-76305-CF_vivid.jpg',0.0),('HD14BMWF80-OE','Seibon OEM Style Carbon Fiber Hood BMW M3 F80 15-19','Seibon Carbon components are carefully hand-crafted using only the finest materials. Our production team offers superior craftsmanship with over 15 years of experience working with carbon fiber.Every component is constructed with a consistent weave pattern. Our production processes allow exceptional carbon/resin ratio, creating high product stiffness that also leads to extra strength. For a stunning finish, our products are coated with a glossy clear coat that does not chip or flake. We meticulously inspect all of our components and stand firmly behind our products so that you can enjoy peace of mind with every genuine Seibon Carbon product.Creating performance-oriented products that help shed unnecessary weight without sacrificing style is our specialty. Race after race, Seibon products have proven to be as strong as the driver\'s ambition to win, thus making Seibon Carbon the preferred brand among professional drivers.',1122.00,'https://www.vividracing.com/wm.php/images/HD14BMWF80-OE.jpg','/Images/vivid/HD14BMWF80-OE_vivid.jpg',0.0),('83.B38.6Q00.71','StopTech Big Brake Kit Black Caliper Drilled Two-Piece Rotor Rear BMW Front 15-20','StopTech Big Brake Kits give your vehicle that supercar performance, look and feel. Each StopTech Big Brake Kit exceed stock kits in two key areas: larger rotors and stiffer calipers. Larger rotors increase heat capacity, allowing a driver to brake harder stop-after-stop with reduced chance of fade. The stiffer calipers and stainless steel lines reduce system compliance, providing consistent pedal feel and confidence-inspiring responsiveness. Every StopTech Balanced Big Brake Kit is engineered to produce that optimal balance using caliper bores and pistons specifically selected and tested for each vehicle application. StopTech Big Brake Kits feature fully forged calipers with patented stiffening bridges, patented 2-piece AeroRotors for optimized cooling, braided stainless steel brake lines, performance brake pads, mounting brackets and all necessary hardware to complete the installation. ',5142.15,'https://www.vividracing.com/wm.php/images/dci/FLMN/STP_83_ST60_71_735x735.jpg','/Images/vivid/83.B38.6Q00.71_vivid.jpg',0.0),('140045','Borla S-Type True Dual Catback Exhaust System Nissan 350Z 2003-2008 3.5L V6','Borla Performance Industries offers an incredible stainless steel exhaust system for the popular Nissan 350Z. Borla was among the first with a performance exhaust upgrade for the original Z cars. The Borla Catback System (PN 140045) is a true dual exhaust with a H-Pipe and the famous Borla XR-1? Race-Bred Mufflers for increased performance and improved sound. Independent dyno tests have shown incredible gains of 15-20 horsepower & torque. When complimented with the Borla custom fabricated stainless steel high quality T-304 Headers (PN 17221), power numbers as high as 25+ horsepower and torque have been observed. Unlike other aftermarket exhaust that actually loose power in mid-range and low end, Borla gains through the entire RPM range. Serious performance enthusiasts understand that true power gains are not simply a big number at max RPM but rather strong torque gains over the full curve. The famous straight-through, patented designs allow Borla exhaust incredible flow increases. The Z car flow numbers improved 27% over stock! Flow makes power. Simple as that!  The Borla true-dual Z-car lightweight high quality T-304 stainless steel system actually weighs 12 pounds less than the factory single exhaust. Add to this package a great look with large 4\" angle cut rolled edge polished T-304 stainless steel tips and that famous Borla growl. Once again, the genuine Borla exhaust puts the Zoom in the Z car. Isn?t it time you stepped up to Borla   Borla Performance Industries, the original pioneers of high quality, T-304 austenitic stainless steel (superior to T-409 or aluminized steel) free flow exhaust utilizes its patented award and race winning technology to deliver quality, sound, performance gains and enhanced fuel economy - all with an easy bolt-on installation. All Borla street products carry the famous Borla written million-mile warranty.',1875.99,'https://www.vividracing.com/wm.php/images/dci/BDLS/140045.jpg','/Images/vivid/140045_vivid.jpg',0.0),('MMRAD-350Z-07','Mishimoto Performance Aluminum Radiator Nissan 350Z 3.5L 2007-2008','Your stock or modified 350Z demands a cooling system that can properly maintain optimal coolant temperatures. An inefficient cooling system can result in overheating, increased engine wear, and potential engine failure. Upgrade your factory plastic radiator with the Mishimoto Nissan 350Z Performance Aluminum Radiator. Our performance radiator features all-aluminum construction and precision robotic TIG-welding for consistency and durability. This radiator features a thick, 2-row brazed aluminum core capable of reducing coolant temperatures significantly. The Mishimoto 350Z Performance Aluminum Radiator features a magnetic oil drain plug with dowty seal and robust threads for durable repeated installation and superior protection against leaks. The sturdy aluminum end tanks feature a subtle brushed finish that complements any engine bay perfectly! As with all our products, this aluminum radiator includes the Mishimoto Lifetime Warranty, ensuring superior product quality and craftsmanship.',338.95,'https://www.vividracing.com/wm.php/images/vr/435/2022/MMRAD-350Z-07_1.jpg','/Images/vivid/MMRAD-350Z-07_vivid.jpg',0.0),('50474-6','H&R Sport Spring BMW M3 Sedan F80 15-19','Sport Spring kits are H&R s number one selling product. Enhance the look of your vehicle with a reduced fender well gap. H&R Sport Springs lower the vehicle center of gravity and reduce body roll for better handling. The progressive spring rate design provides superb ride quality and comfort. A lower wind resistance signature will make the vehicle more streamlined and improve gas mileage. If you are only looking to improve one part of your vehicle s suspension, you cannot go wrong with installing Sport Springs. Fun to drive, H&R Sport Springs are the number one upgrade for your vehicle.',317.85,'https://www.vividracing.com/wm.php/images/HR-Sport-Springs.jpg','/Images/vivid/50474-6_vivid.jpg',0.0),('KLC140-255','Whiteline Sway bar link BMW | Ford | Mazda | Nissan 2007-2021','Not many enthusiasts are aware that OE and more importantly aftermarket sway bar effectiveness can be hindered by worn or inadequate mounts, drop links and lateral stoppers. Whiteline adjustable sway bar links are engineered to be up to the task with top spec, light weight componentry combined with a window of adjustability, eliminating sway bar preload on installation but most importantly ensuring the maximum output of the sway bar for improved grip and better handling.Whiteline Sway bar - link.Fits position: FrontFits position: Rear',171.13,'https://www.vividracing.com/wm.php/images/sema/FMSM/KLC140-255.jpg','/Images/vivid/KLC140-255_vivid.jpg',0.0),('SES1116ICPWB','Injen SES Intercooler Pipes BMW M3 | M4 3.0L Twin Turbo 2015-2019 CLEARANCE','We have this NEW item instock and on CLEARANCE.  This is an open box but has everything as new.  All CLEARANCE items are sold as is and cannot be returned or exchanged.  Clearance items are generally old stock, returned parts, or used.  They are described in the best condition as possible.Injen Intercooler pipes are the next logical step in your search for power gains. The Injen staff has put in the time and work to develop parts that perform. These Intercooler pipes are no different, after investigating the OE piping, our engineers identified numerous areas where improvement was necessary. The Injen performance intercooler pipes are constructed of mandrel-bent aluminum piping that eliminates the rust buildup present in the most stock pipes. Injens Automotive Grade Silicone Couplers and Stainless Steel Band Clamp with Inner Protective Liner are also included in this kit. The Injen technology Silicone Couplers are on a new level. Compared to normal silicone, Injen Automotive Grade Silicone Couplers provide superior resistance to heat, pressure, fuel, and oil. This effectively increases the life of the couplers by preventing leaks and blowouts. The Injen Intercooler Pipe Kit is designed to work with the stock as well as the Injen performance intercooler*. This Intercooler pipe performance kit, like all of our Injen performance parts, includes the Injen Limited Lifetime Warranty.',535.03,'https://www.vividracing.com/wm.php/images/ses1116icpwb_floating.jpg','/Images/vivid/SES1116ICPWB_vivid.jpg',0.0),('PT0008B','Injen X-Pedal Pro Black Edition Throttle Controller BMW 1999-2020','The Injen Technology X-Pedal Pro Black Edition is the next step in customizable throttle response controllers. Quickly and easily tune out the delayed throttle response from the factory with Injen\'s X-Pedal Pro Black Edition for a completely new driving experience. You\'ll be amazed how different your vehicle feels after this quick and simple install!Modern vehicles are infamous for a sluggish and delayed throttle response feel directly from the factory. You\'ll recognize this built-in delay when trying to accelerate to pass another vehicle or merging into traffic. Injen Technology\'s X-Pedal Pro Black Edition allows you to adjust the pedal feel and ultimately the throttle response of your vehicle directly on the fly.The X-Pedal Pro Black Edition is a plug-in module that requires less than 5 minutes to install and delivers immediate, customized performance for your vehicle. Specifically, the X-Pedal Pro Black Edition controls the throttle signals going into your stock ECU (Engine Control Unit) so that your vehicle instantly responds faster and accelerates swifter... or slower and more economically - depending on how you program the X-Pedal Pro Black Edition. The choice is yours.  ',229.95,'https://www.vividracing.com/wm.php/images/202006/INJEN_PT000XB.jpg','/Images/vivid/PT0008B_vivid.jpg',0.0),('S90-7-20-036','Eibach Pro-Spacer Kit (20mm Pair)  BMW 2012-2021','With the Eibach PRO-SPACER installed, the car looks wider and better, as the wheel fills the arch. That\'s how the car\'s look gets its final touch.By increasing the track width, not only the appearance is improved, but you also achieve an optimized driving behavior combined with higher stability, as the roll of the chassis is influenced in a positive manner.',161.00,'https://www.vividracing.com/wm.php/images/sema/DMWF/S90-7-20-036.jpg','/Images/vivid/S90-7-20-036_vivid.jpg',0.0),('VH423704','Koyo Aluminum High-Performane Front Mount Heat Exchanger BMW M2 | M3 | M4','Reduce Intake Air Temperatures (IAT) with Koyorad\'s new all-aluminum high-performance front mount heat exchanger for the 15-20 BMW F8X: M3, M4, and M2 Competition. Our high-density core is 33% thicker than the OEM heat exchanger core, yet was specifically designed with a slimmer profile than most competitors to have minimal impact to the airflow through to the radiator behind it. This heat exchanger retains 100% of the OEM style mounts and hoses, with CNC machined billet components and quick connect fittings requiring no modifications.\n\n',870.00,'https://www.vividracing.com/wm.php/images/vr/161/2022/VH423704.jpg','/Images/vivid/VH423704_vivid.jpg',0.0),('AMS.38.14.0001-2','AMS Performance Alpha 6 GTX3076 Gen II Street Turbo Kit Toyota GR Supra A90 2020','Our AMS SnailWorksÂ© Engineering Team has spent hundreds of R&D hours refining the AMS Performance A90 2020 Toyota GR Supra ALPHA 6 and ALPHA 8 Street Turbo Kits to be the best performing, highest quality, and easiest to install kit on the market. The MKV turbo kit is designed with minimal bends and restrictions by our team to smoothly and efficiently feed more air through the intake and exhaust path and into the B58 engine. Then, focusing on the small details, our team designed the CNC machined adapters to allow the AN coolant and oil lines to install directly to the B58 engine for a leak-free install. We also designed and created our own CNC machined actuator rod adapter to allow us to mount the factory electronic wastegate to the new turbo.The AMS SnailWorksÂ© Engineering Team has designed the ALPHA Turbo Kits to be a direct bolt-in install without hacking up your prized possession. The ALPHA 6 and 8 are fully compatible with A/C, power steering, and all other factory options, and is easily reversible back to stock with a few inexpensive replacement parts. The design of the new Toyota GR Supra ALPHA Turbo Kits position them to be the best performing, highest quality, and easiest to install kits on the market. The best part about the AMS ALPHA Turbo Kits is that they are fully compatible with the high quality AMS 3â€³ Charge Pipe you already have installed so there is no need to buy a charge pipe twice like with the competition.Adding more horsepower to the new Toyota GR Supra has never been easier, with the new AMS Performance A90 2020 Toyota GR Supra ALPHA 6 and ALPHA 8 Street Turbo Kits. Our team has engineered and built the 2020 GR Supra platformâ€™s first publicly available internally gated full turbo kit that utilizes the OEM electronic wastegate. This unique advancement allows for a seamless integration of the OEM ECU for boost control the way it was intended from the factory. The GR Supraâ€™s electronic wastegate system particularly excels at boost response over mechanical alternatives, making it the ultimate choice for part throttle drivability or on-off throttle situations as seen on a road course.',6399.95,'https://www.vividracing.com/wm.php/images/vr/449/2021/AP_turbomain.jpg','/Images/vivid/AMS.38.14.0001-2_vivid.jpg',0.0),('HT-055016','Haltech Platinum PRO Direct Plug in ECU Kit Nissan 350Z Manual Transmission 03-08','Fully programmable ECU interfacing directly with all the standard Nissan sensors and on board computer systems. Taking control of all the essential engine management tasks such as fuel delivery, ignition timing, boost levels, camshaft positioning and correction maps, the Platinum Pro Plug-in 350Z (Z33) ECU even interfaces with the factory Nissan CAN bus for on-board diagnostics and troubleshooting.',2010.00,'https://www.vividracing.com/wm.php/images/HT-055016.jpg','/Images/vivid/HT-055016_vivid.jpg',0.0),('352208CG','KW Clubsport Kit 2 Way with Top Mounts BMW Z4  (G29) | Toyota GR Supra (A90) 2019+','The KW Clubsport coilovers combine KW\'s high-end racing technology with maintenance-free KW OEM components and part certificate.This will provide you the ideal product to take full potential of your sports car during track days, sports car driving clinics, enthusiast drives on Grand Prix circuits and on tracks such as the Nurburgring Nordschleife.The KW Clubsport coilovers provide the ability to adjust for different track surfaces, sharp turns and abrupt elevation changes. The KW Clubsport is in its home environment on the famous twists and turns of the 20.8 km long Nurburgring Nordschleife circuit.As a supporting suspension manufacturer to numerous different racing series. KW had claimed 6 ADAC Zurich 24-hour victories within 10 years at the famous Nurburgring circuit and the ADAC GT Masters 2011 Championship. More then 70 race teams are equipped with KW coilover systems in the VLN Endurance Championship series. These race teams rely on KW\'s racing expertise and experience for their vehicle setup. This information is mirrored in the development of the KW Clubsport coilover systems.The KW Clubsport 2-way and KW Clubsport 3-way (with separate reservoir) provides the user numerous adjustment settings. This allows to user to dial the suspension setup to his/hers driving style and to adjust or match the tire/wheel setup of the vehicle.Rebound and compression dampening is independently adjustable by hand via the integrated click adjusters. Adjustable top mounts are optional on certain applications.The rebound adjuster knob provides 16 precise clicks to personally dial in your desired vehicle setup. Thus allowing you the possibility to influence wheel/tire loads or take into concern chassis characteristics. Independent from rebound adjustment is the compression dampening, 12 precise adjustment clicks are provided to adjust the low-speed dampening. Most notably used to dial in wheel/tire setup.These adjustment features allow the user to dial in vehicle weight, wheel/tire combinations, various road surfaces and environmental conditions.',3549.00,'https://www.vividracing.com/wm.php/images/202006/KW_39710252.jpg','/Images/vivid/352208CG_vivid.jpg',0.0),('28664-90','H&R Sport Spring Toyota Supra A90 2020-2023','Suspension is one of the most important factors in determining your vehicle\'s day-to-day drivability. The first step in suspension tuning is to upgrade your vehicle\'s stock springs. Upgrading your suspension components will ensure that your vehicle has improved handling and reduced body roll. H&R springs have superb ride comfort and increased driving convenienceSport Spring kits are H&R\'s number one selling product. Enhance the look of your vehicle with a reduced fender well gap. H&R Sport Springs lower the vehicle center of gravity and reduce body roll for better handling. The progressive spring rate design provides superb ride quality and comfort. A lower wind resistance signature will make the vehicle more streamlined and improve gas mileage. If you are only looking to improve one part of your vehicle\'s suspension, you cannot go wrong with installing Sport Springs. Fun to drive, H&R Sport Springs are the number one upgrade for your vehicle.',304.85,'https://www.vividracing.com/wm.php/images/HRSportSprings.jpg','/Images/vivid/28664-90_vivid.jpg',0.0);
